

var TIMEOUT = 5000;
var SPEED	= 50;
function ImageView(options) {
	// Checks if the spinner directory exists
	var imageDir = Ti.Filesystem.applicationDataDirectory+'spinner/';
	var f = Ti.Filesystem.getFile(Ti.Filesystem.applicationDataDirectory,'spinner');
	f.createDirectory();
	// if the files don't exists then we need to create them using the data below
	if (!Ti.Filesystem.getFile(imageDir+'blank.png').exists() || !Ti.Filesystem.getFile(imageDir+'9.png').exists()) {
		// creates each image
		var img = Ti.Filesystem.getFile(imageDir,'blank.png');
		img.write(defaultImage);
		for (var i=0;i<images.length;i++) {
			var imageData = images[i];
			 img = Ti.Filesystem.getFile(imageDir,i.toString()+'.png');
			 img.write(imageData);
		}
	}
	
	
	var self = Ti.UI.createView(options);
	self._loaded = false;
	
	var index=9;
	var loaderImage = Ti.UI.createImageView({ image : imageDir+'9.png' });
	
	/**
	 * Switches the images to simulate a spinner
	 */
	var rotateImage = function() {
		if (self._loaded) return;
		index--;
		index = index < 0 ? 9 : index;
		loaderImage.setImage(imageDir+index.toString()+".png");
		if (!self._loaded) {
			setTimeout(rotateImage, SPEED);
		}
	}	

	/**
	 * When the image is fully loaded or timesouts
 	 * @param {Object} e
	 */
	var loadComplete = function(e) {
		e = e ? e : { state : 'Timed out!' };
		self._loaded = true;
		self.remove(loaderImage);
		
		if (e.state) {
			// correctly loaded
			return;
		} else {
			// load non-image
			mainImage.setImage('/images/graphics/tableView/default_sm.png');
		}
	}
	
	var mainImage = Ti.UI.createImageView({
		image : options.image,
		width : options.width,
		height : options.height,
		load : loadComplete,
		defaultImage : imageDir+'blank.png'
	});
	
	self.add(mainImage);
	self.add(loaderImage);
	
	self.imageView = mainImage;	
	// time out
	setTimeout(function() {
		loadComplete({state:'Timed out!'});

	}, TIMEOUT);
	rotateImage();
	return self;	
	
}

module.exports = ImageView;

